import React from 'react'
import { Table } from 'antd'

export default(props)=>
{
  const dataSource = [
    {
      key: "1",
      name: "Ceara",
      age: 32,
      address: "Ceara",
      description:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit. ",
    },
    {
      key: "2",
      name: "Ceara",
      age: 42,
      address: "Ceara",
      description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit. ",

    },
    {
      key: "3",
      name: "Ceara",
      age: 42,
      address: "Ceara",
      description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit.",

    },
  ];

  const columns = [
    {
      title: "Name",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Age",
      dataIndex: "age",
      key: "age",
    },
    {
      title: "Address",
      dataIndex: "address",
      key: "address",
    },
    {
      title: "Description",
      dataIndex: "description",
      key: "description",
    },
  ];
      
      <Table dataSource={dataSource} columns={columns} />;
}
